import React from "react";

const Tree = (props) => {
  const txDivs = [];
  props.tree.forEach((tx) => {
    txDivs.push(<div>{tx}</div>);
  });
  return (
    <div>
      <div>{txDivs}</div>
    </div>
  );
};

export default Tree;
